import React, { useEffect, useState } from "react";
import './Usertweets.css';
import { useNavigate } from "react-router";
import axios from 'axios';
import Button from '@material-ui/core/Button';
import ChatBubbleIcon from '@mui/icons-material/ChatBubble';
import ThumbUpIcon from '@mui/icons-material/ThumbUp';
import DeleteIcon from '@mui/icons-material/Delete';
//import Button from '@material-ui/core/Button';
import CreateIcon from '@mui/icons-material/Create';
import Usertweetsdisplay from './Usertweetsdisplay';
const Usertweets=(props)=>{
    const navigate=useNavigate();
    const[title,setTitle]=useState('');
    const[description,setDescription]=useState('');
    const loginId=localStorage.getItem('usrname');
    const [post,setPost]=useState([]);
    const postTweetHandler=async()=>{
        //e.preventDefault();

        const requestBody={
            title:title,
            tweet:description
        }
        console.log(requestBody);

        try{
            const response=await axios.post(`http://localhost:8081/postTweet/${loginId}/add`,requestBody);
            const tweetid=localStorage.setItem(response.data.tweetId);
            console.log(response);
            const tweetPost=await response.data;
            setPost(tweetPost)
        }catch(e){}
    }

    useEffect(() => {
        postTweetHandler();   
    },[])

    const titleHandler=(e)=>{
        setTitle(e.target.value);
    }

    const descriptionHandler=(e)=>{
        setDescription(e.target.value);
    }
    return(
        <>
       <div className="header" >
           <a href="" className="logo">Just Tweet it !</a>

           <div className="header-left">
              <a href="" onClick={()=>navigate("/homepage")}> Tweets </a>
              <a href="" className="active"> Your Tweets </a>
              <a href="" onClick={()=>navigate("/homepage/users")}> Users </a>
           </div>
            <div className="header-right">
                <a href="" >Logout</a>
            </div>      
       </div>
       
            <div className="h3">
                <h3>Welcome {loginId} !</h3>
            </div>
        <div>
        <form onSubmit={postTweetHandler}>
            <br></br>
            <div className="box1">
                <textarea 
                    rows="2" 
                    cols="50" 
                    name="title"  
                    placeholder="Add the title" 
                    value={title}
                    onChange={titleHandler} />
            </div>
            <div className="box1">
                <textarea 
                     rows="5" 
                     cols="50"
                    name="description" 
                    placeholder="Want to express ? Express it." 
                    value={description}
                    onChange={descriptionHandler}/>
            </div>
           
            <div className="button">
                <Button type="submit" color="primary" variant="contained" >Post Tweet</Button>
            </div>
        </form>
        </div>
        <div>
        <div className="box">
                    <div className="tweetdisplay">
                    <div className="tweetdisplay__body">
                        <div className="tweetdisplay__header">
                            <div className="tweetdisplay_headerText">
                                <h5>
                                    {post.loginId}
                                    <span className="tweetdisplay__createDate">formattedDate({post.creationDate})</span>
                                </h5>
                            </div>
                            <div className="tweetdisplay__headerTitle">
                                    <h4>{post.title}</h4>
                            </div>
                            <div className="tweetdisplay__headerDescription">
                                <p>{post.tweet} </p>
                            </div>
                        </div>
                        <div className="tweetdisplay__footer" >
                           
                            <Button color="primary" variant="contained"><ChatBubbleIcon fontSize="small" >
                                
                            </ChatBubbleIcon>
                            </Button>
                            <Button color="primary" variant="contained"><ThumbUpIcon fontSize="small" />{post.likes}</Button>
                            <Button color="primary" variant="contained" ><DeleteIcon fontSize="small" /></Button>
                            <Button color="primary" variant="contained"><CreateIcon fontSize="small" /></Button>

                        </div>
                    </div>
                </div>
                </div>
        </div>
       </>
    )
}

export default Usertweets;
